import csv
def cmp(a, b):
    return (a > b) - (a < b)
with open("stocks.csv", "w", newline="") as stocksFileW:
    writer = csv.writer(stocksFileW)
    writer.writerows(
        [
            ["GOOG", "Google, Inc.", 505.24, 0.47, 0.09],
            ["YHOO", "Yahoo! Inc.", 27.38, 0.33, 1.22],
            ["CNET", "CNET Networks, Inc.", 8.62, -0.13, -1.4901],
